function Home() {
    return (
        <div className="container alignMiddle">
            <div className="innerContainer alignMiddle">
                <h1>To be your eyes on the road.</h1>
                <button className="button launch" onClick={() => window.location.replace("http://localhost:3000/record")}>Launch</button>
            </div>
        </div>
    );
}

export default Home
